import Button from 'react-bootstrap/Button';
import React from 'react';
import Navbar from 'react-bootstrap/Navbar';

function Header () {
  return (
    <Navbar bg="dark" variant="dark" fixed="top" className="d-flex justify-content-end">
      <Navbar.Brand href="#home" className="d-flex justify-content-end" >Incli</Navbar.Brand>
      <div className="d-flex flex-row-reverse">
        <Button variant="outline-info" className="d-flex justify-content-end">
          Top!
        </Button>
      </div>
    </Navbar>
  );
}

export default Header;
